import AboutCard from './AboutCard.js'
import Typography from '@material-ui/core/Typography';
import LogoGroup from '../Assets/logo_group.jpg'



const About = () => {
    return (
        <div >
        <AboutCard />
        <Typography variant="h5" color="textSecondary" component="p" className="subTitle" style={{fontFamily: 'montserrat', letterSpacing: '-0.02em',  maxWidth: "100%", marginLeft: "7%", marginRight: "7%"}}>
            Software Developer & Entrepreneur
        </Typography>
        <img src={LogoGroup} style={{margin: "7% 7% 7% 7%", maxWidth: "100%"}}></img>




        </div>
    )
}

export default About
